void *code_fortran_YYalloc (yy_size_t  size )
{
	return (void *) malloc( size );
}

void *code_fortran_YYrealloc  (void * ptr, yy_size_t  size )
{
	/* The cast to (char *) in the following accommodates both
	 * implementations that use char* generic pointers, and those
	 * that use void* generic pointers.  It works with the latter
	 * because both ANSI C and C++ allow castless assignment from
	 * any pointer type to void*, and deal with argument conversions
	 * as though doing an assignment.
	 */
	return (void *) realloc( (char *) ptr, size );
}

void code_fortran_YYfree (void * ptr )
{
	free( (char *) ptr );	/* see code_fortran_YYrealloc() for (char *) cast */
}

#define YYTABLES_NAME "yytables"

static void checkContLines(const QString &str)
{
   int numLines = 2;          // one for element 0, one in case no \n at end

   for (auto c : str) {
      if (c == '\n') {
        numLines++;
      }
   }

   s_hasContLine.resize(numLines);

   for (int i = 0; i < numLines; i++) {
      s_hasContLine[i] = 0;
   }

   prepassFixedForm(str, s_hasContLine);
   s_hasContLine[0] = 0;
}

void resetFortranCodeParserState() {}

void parseFortranCode(CodeOutputInterface &od, const QString &className, const QString &s,
                  bool exBlock, const QString &exName, QSharedPointer<FileDef> fd, int startLine,
                  int endLine, bool inlineFragment, QSharedPointer<MemberDef> memberDef, bool,
                  QSharedPointer<Definition> searchCtx, bool collectXRefs, FortranFormat format)
{
   if (s.isEmpty()) {
      return;
   }

   printlex(code_fortran_YY_flex_debug, true, __FILE__, fd ? fd->fileName() : "" );

   TooltipManager::instance()->clearTooltips();
   s_code = &od;

   s_inputString      = s;
   s_inputPosition    = 0;
   s_isFixedForm      = recognizeFixedForm(s, format);
   s_currentFontClass = "";

   s_contLineNr       = 1;

   s_hasContLine.clear();
   s_needsTermination = false;

   if (s_isFixedForm) {
      checkContLines(s_inputString);
   }

   s_searchCtx        = searchCtx;
   s_collectXRefs     = collectXRefs;

   if (startLine != -1) {
      s_yyLineNr = startLine;
   } else {
      s_yyLineNr = 1;
   }

   if (endLine != -1) {
      s_inputLines  = endLine + 1;
   } else {
      s_inputLines  = countLines();
   }

   s_exampleBlock  = exBlock;
   s_exampleName   = exName;
   s_sourceFileDef = fd;

   if (exBlock && fd == 0) {
      // create a dummy filedef for the example
      s_sourceFileDef = QMakeShared<FileDef>("", exName);
   }

   if (s_sourceFileDef) {
      setCurrentDoc("l00001");
   }

   s_currentDefinition = QSharedPointer<Definition>();
   s_currentMemberDef  = QSharedPointer<MemberDef>();

   if (! s_exampleName.isEmpty()) {
      s_exampleFile = convertNameToFile_X(s_exampleName + "-example");
   }

   s_includeCodeFragment = inlineFragment;
   startCodeLine();
   s_parmName.resize(0);
   s_parmType.resize(0);

   code_fortran_YYrestart(code_fortran_YYin );
   BEGIN( Start );
   code_fortran_YYlex();

   if (s_needsTermination) {
      endFontClass();
      s_code->endCodeLine();
   }

   if (fd) {
      TooltipManager::instance()->writeTooltips(*s_code);
   }

   if (exBlock && s_sourceFileDef) {
      // delete the temporary file definition used for this example
      s_sourceFileDef = QSharedPointer<FileDef>();
   }

   s_hasContLine.clear();

   printlex(code_fortran_YY_flex_debug, false, __FILE__, fd ? fd->fileName() : "" );

   return;
}

